using LandauDistributionFP128;
using Float128 = MultiPrecision.MultiPrecision<MultiPrecision.Pow2.N4>;

namespace LandauDistributionFP128Tests {
    [TestClass()]
    public class LandauDistributionFP128Tests {
        readonly LandauDistribution dist1 = new();
        readonly LandauDistribution dist2 = new(mu: 1, c: 3);
        readonly LandauDistribution dist3 = new(c: Float128.PI / 2);

        LandauDistribution[] Dists => [
            dist1,
            dist2,
            dist3,
        ];

        [TestMethod()]
        public void PDFExpectedTest() {
            Float128[] expected_dist1 = [
                "0.26224012637535165702558960818351647131488",
                "0.16353124086802260347581305180210465276342",
                "0.09552422613347715880939678564641570105835",
                "0.058639488338036182406230216968451367658605",
            ];
            Float128[] expected_dist2 = [
                "0.071386208190096275232974939388451951503325",
                "0.09034495984298569669047391552324642172044",
                "0.094394441224405469671292027847763404499171",
                "0.088330234786125599963918354174713480460719",
            ];
            Float128[] expected_dist3 = [
                "0.1788541606752494350522184701049029306527",
                "0.14520663709640194253543670745173917702186",
                "0.10491298948062606683154508721941478042004",
                "0.074247654599601391859420961787839066228566"
            ];

            foreach ((LandauDistribution dist, Float128[] expecteds) in new[]{
                (dist1, expected_dist1), (dist2, expected_dist2), (dist3, expected_dist3)
            }) {
                for ((double x, int i) = (0, 0); i < expecteds.Length; x++, i++) {
                    Float128 expected = expecteds[i];
                    Float128 actual = dist.PDF(x);

                    Console.WriteLine($"{dist} pdf({x})");
                    Console.WriteLine(expected);
                    Console.WriteLine(actual);

                    Assert.IsTrue(Float128.Abs(expected - actual) / expected < 1e-33, $"{dist} pdf({x})\n{expected}\n{actual}");
                }
            }
        }

        [TestMethod()]
        public void CDFExpectedTest() {
            Float128[] expected_dist1 = [
                "0.36523870151237479737194439020223633291056",
                "0.57786675964195234763672948547568695034661",
                "0.7041078620442087836222235772345264997212",
                "0.77929667335886839426384516762385423860565",
            ];
            Float128[] expected_dist2 = [
                "0.089025690862002326730788800286931308472899",
                "0.17119311431882309272302517476020685228892",
                "0.26465854238058656382405236936912989295617",
                "0.35660981082631671642087633416865166990034",
            ];
            Float128[] expected_dist3 = [
                "0.28683288012541777456762653857930445793622",
                "0.45101809281952585982591839302215356640746",
                "0.57552793470311284602984134883063400264538",
                "0.66420599752421811067770244822103832701462",
            ];

            foreach ((LandauDistribution dist, Float128[] expecteds) in new[]{
                (dist1, expected_dist1), (dist2, expected_dist2), (dist3, expected_dist3)
            }) {
                for ((double x, int i) = (0, 0); i < expecteds.Length; x++, i++) {
                    Float128 expected = expecteds[i];
                    Float128 actual = dist.CDF(x);

                    Console.WriteLine($"{dist} cdf({x})");
                    Console.WriteLine(expected);
                    Console.WriteLine(actual);

                    Assert.IsTrue(Float128.Abs(expected - actual) / expected < 1e-33, $"{dist} cdf({x})\n{expected}\n{actual}");
